import React, { Component } from "react";
import Tracks from "../Tracks/Tracks";
import Search from "../Tracks/Search";

const Index = () => {
  return (
    <React.Fragment>
      <Search />
      <Tracks />
    </React.Fragment>
  );
};

export default Index;
